Definition of Locality-Sensitive Hashing Family: A finite family \(\mathcal F\) of functions \(h\colon M \to S\) is defined to be an locality-sensitive hashing (LSH) family for
\begin{itemize}
    \item a metric space \(\mathcal M=(M, d)\),
    \item a threshold \(r>0\),
    \item an approximation factor \(c>1\),
    \item and probabilities \(p_1 > p_2\)
\end{itemize}
if it satisfies the following condition. For any two points \(a, b \in M\) and a hash function \(h\) chosen uniformly at random from \(\mathcal F\):
\begin{itemize}
    \item If \(d(a,b) \le r\), then \(h(a)=h(b)\) (i.e., \(a\) and \(b\) collide) with probability at least \(p_1\),
    \item If \(d(a,b) \ge cr\), then \(h(a)=h(b)\) with probability at most \(p_2\).
\end{itemize}

