Definition of Natarajan Dimension: Let \(H\) be a set of functions from a set \(X\) to a set \(Y\). \(H\) shatters a set \(C \subset X\) if there exist two functions \(f_0, f_1 \in H\) such that
\begin{itemize}
    \item For every \(x \in C, f_0(x) \neq f_1(x)\).
    \item For every \(B\subset C\), there exists a function \(h \in H\) such that for all \(x \in B, h(x) = f_0(x)\) and for all \(x \in C - B, h(x) = f_1(x)\).
\end{itemize}
The Natarajan dimension of \(H\) is the maximal cardinality of a set shattered by \(H\).

