Definition of Occam Algorithm: Let \(\mathcal{C}\) and \(\mathcal{H}\) be concept classes containing target concepts and hypotheses respectively. Then, for constants \(\alpha \ge 0\) and \(0 \le \beta <1\), a learning algorithm \(L\) is an \((\alpha,\beta)\)-Occam algorithm for \(\mathcal{C}\) using \(\mathcal{H}\) iff, given a set \(S = \{ x_1, \dots, x_m \}\) of \(m\) samples labeled according to a concept \(c \in \mathcal{C}\), \(L\) outputs a hypothesis \(h \in \mathcal{H}\) such that
\begin{itemize}
    \item \(h\) is consistent with \(c\) on \(S\) (that is, \(h(x)=c(x),\forall x \in S\)), and
    \item \(size(h) \le (n \cdot size(c))^\alpha m^\beta\)
\end{itemize}
where \(n\) is the maximum length of any sample \(x \in S\).

