Definition of Tucker Decomposition: For a 3rd-order tensor \(T \in F^{n_{1} \times n_{2} \times n_{3}}\), where \(F\) is either \(\mathbb{R}\) or \(\mathbb{C}\), Tucker Decomposition can be denoted as follows, \(T = \mathcal{T} \times_{1} U^{(1)} \times_{2} U^{(2)} \times_{3} U^{(3)}\) where \(\mathcal{T} \in F^{d_{1} \times d_{2} \times d_{3}}\) is the core tensor, a 3rd-order tensor that contains the 1-mode, 2-mode and 3-mode singular values of \(T\), which are defined as the Frobenius norm of the 1-mode, 2-mode and 3-mode slices of tensor \(\mathcal{T}\) respectively. \(U^{(1)}, U^{(2)}, U^{(3)}\) are unitary matrices in \(F^{d_{1} \times n_{1}}, F^{d_{2} \times n_{2}}, F^{d_{3} \times n_{3}}\) respectively. The \(k\)-mode product (\emph{k} = 1, 2, 3) of \(\mathcal{T}\) by \(U^{(k)}\) is denoted as \(\mathcal{T} \times U^{(k)}\) with entries as
\begin{align}
    (\mathcal{T} \times_{1} U^{(1)})(i_{1}, j_{2}, j_{3}) &= \sum_{j_{1}=1}^{d_{1}} \mathcal{T}(j_{1}, j_{2}, j_{3})U^{(1)}(j_{1}, i_{1}) \\
    (\mathcal{T} \times_{2} U^{(2)})(j_{1}, i_{2}, j_{3}) &= \sum_{j_{2}=1}^{d_{2}} \mathcal{T}(j_{1}, j_{2}, j_{3})U^{(2)}(j_{2}, i_{2}) \\
    (\mathcal{T} \times_{3} U^{(3)})(j_{1}, j_{2}, i_{3}) &= \sum_{j_{3}=1}^{d_{3}} \mathcal{T}(j_{1}, j_{2}, j_{3})U^{(3)}(j_{3}, i_{3})
\end{align}
Altogether, the decomposition may also be written more directly as
\[T(i_{1}, i_{2}, i_{3})=
\sum_{j_{1}=1}^{d_{1}}
\sum_{j_{2}=1}^{d_{2}}
\sum_{j_{3}=1}^{d_{3}}
\mathcal{T}(j_{1}, j_{2}, j_{3})
U^{(1)}(j_{1}, i_{1})
U^{(2)}(j_{2}, i_{2})
U^{(3)}(j_{3}, i_{3})\]

