Definition of Discrete Hidden Markov Model: Let \(X_n\) and \(Y_n\) be discrete-time stochastic processes and \(n\geq 1\). The pair \((X_n,Y_n)\) is a hidden Markov model if
\begin{itemize}
    \item \(X_n\) is a Markov process whose behavior is not directly observable ("hidden");
    \item \(\operatorname{\mathbf{P}}\bigl(Y_n \in A\ \bigl|\ X_1=x_1,\ldots,X_n=x_n\bigr)=\operatorname{\mathbf{P}}\bigl(Y_n \in A\ \bigl|\ X_n=x_n\bigr),\) for every \(n\geq 1,\) \(x_1,\ldots, x_n,\) and every Borel set \(A\).
\end{itemize}

