Definition of Continuous Hidden Markov Model: Let \(X_t\) and \(Y_t\) be continuous-time stochastic processes. The pair \((X_t,Y_t)\) is a hidden Markov model if
\begin{itemize}
    \item \(X_t\) is a Markov process whose behavior is not directly observable ("hidden");
    \item \(\operatorname{\mathbf{P}}(Y_{t_0} \in A \mid \{X_t \in B_t\}_{ t\leq t_0}) = \operatorname{\mathbf{P}}(Y_{t_0} \in A \mid X_{t_0} \in B_{t_0})\), for every \(t_0,\) every Borel set \(A,\) and every family of Borel sets \(\{B_t\}_{t \leq t_0}.\)
\end{itemize}

