Definition of Basic Elements of Reinforcement Learning: Basic reinforcement learning is modeled as a Markov decision process:
\begin{itemize}
    \item a set of environment and agent states, \(\mathcal{S}\);
    \item a set of actions, \(\mathcal{A}\), of the agent;
    \item \(P_a(s,s')=\Pr(S_{t+1}=s'\mid S_t=s, A_t=a)\), the probability of transition (at time \(t\)) from state \(s\) to state \(s'\) under action \(a\);
    \item \(R_a(s,s')\), the immediate reward after transition from \(s\) to \(s'\) with action \(a\).
\end{itemize}
